window.bookSummaryJSON = "<p>You think you know the tale as old as time, but you've already got it wrong. There never was a beauty and a beast, only a girl who was both. And that girl was me.</p> <p>Zaina will never be free.</p> <p>She's forced into an arranged marriage to a Viking King in a castle full of secrets. But she carries secrets of her own, and the scars of her haunted past.</p> <p>Handed off from one monster to another, she has no choice but to do her best to survive and protect her sisters.</p> <p>Even if it costs her everything.</p> <p>A <i>Beauty and the Beast</i> retelling you won't want to miss, where nothing is what it seems and time is running out.</p>"; 
